We then attempt a standard CYK fill. The start symbol S only appears once in the grammar:

   S → NT14 NT72

So in the full span (positions 1 – 10) we would need NT14 covering some prefix 1 – k and NT72 covering k+1 – 10.  A modest CYK‐style check of all shorter spans shows that

• NT14 never appears in any cell covering more than a single position (t14, t31, t49, t81, t87 are its only direct terminals), and  
• NT72 likewise never appears in the exact complementary subspan needed,

so there is no way to get S over the entire length. Hence the string is not in the language.

