After examining all of NT14’s binary productions, each one’s leftmost nonterminal can only derive terminals in the sets:

• NT22 ⇒ {t85, t8, t26, t1, t27, t80}  
• NT41 ⇒ {t28, t77, t85}  
• NT7  ⇒ {t39}  
• NT72 ⇒ {t82, t54, t60, t62}  
• NT29 ⇒ {t40, t34, t22, t61, t91, t11}  
• NT59 ⇒ {t56, t81, t74}  
• NT52 ⇒ {t24, t27, t5, t22, t20}

None of these include t38, so NT14 (the left child of S) can never begin with t38. Since the given string starts with t38, it cannot be generated by S → NT14 NT72. 

